import React from "react";
import NavTile from 'views/components/display/NavTile';
import getCategoryList from 'data/Categories';
import withRouterHooks from "helpers/withRouterHooks";
import HeaderLarge from "views/components/display/HeaderLarge";

class Services extends React.Component {
  render() {
    let categories = getCategoryList();
    let category = categories.categories.find(element => element.name === this.props.params.category);

    return (
      <>
        <div className="text">
          <HeaderLarge displayName={category.displayName} />
        </div>

        <div className="groupPromo">
          <div className="listWebpart">
            <ul>
              {
              category.forms.map((form) => {
                let route = "/" + form.name + "/Description";
                return (
                  <li key={form.name}>
                    <NavTile to={route} header={form.displayName} description={form.description} />
                  </li>
                );
              })
              }

            </ul>
          </div>
        </div>
      </>
    );
  }
}

export default withRouterHooks(Services);
